import React from 'react';
import s from './Profile.module.css';
import Interests from "./Interests";

const Profile = (props) => {
    let changeItemsInterests=()=>{
        let interests = {
            "sport": 0,
            "creation": 1,
            "music": 0,
            "literature": 0,
            "film": 0,
            "science": 0,
            "cars": 1,
            "technology": 0,
            "politics": 0,
            "travel": 1,
            "cooking": 0,
            "art": 0,
            "games": 1,
            "craft": 1,
            "parenting": 0
        }
        props.changeInterests(interests)
    }
    return (
        <div>
            <div className={s.descriptionBlock}>
               <div>Имя пользователя: {props.profilePage.name}</div>
                <div>Рейтинг: {props.profilePage.rating}</div>
                <Interests interests={props.profilePage.interests}/>
                <button onClick={changeItemsInterests}>Изменить</button>

            </div>
        </div>
    )
}


export default Profile;
